import Header from "./Header";
import Card from "./Card";
import addCardImage from "../images/add-card.svg";

function Main({cards}) {
  

  return (
    <>
      <Header />
      <main className="content">
      <section className="elements">
      <article className="element">
            <button className="element__add-button" />
        </article>
        {cards.map((card) => {
          return (
            <Card/>
          );
        })}
      </section>
      <model-viewer src="Horse.glb" ar ar-modes="webxr scene-viewer quick-look" camera-controls poster="poster.webp" shadow-intensity="1" autoplay>
    <div class="progress-bar hide" slot="progress-bar">
        <div class="update-bar"></div>
    </div>
    <button slot="ar-button" id="ar-button">
        View in your space
    </button>
    <div id="ar-prompt">
        <img src="https://modelviewer.dev/shared-assets/icons/hand.png" alt='sda' />
        </div>
      </model-viewer>
    </main>
    </>
  );
}

export default Main;
